css:
status-bar .latex-status .latex-message-count {
  padding-left: 0.5em;
}
status-bar .latex-status .latex-highlight {
  color: #fff;
}
status-bar .latex-status .latex-info {
  color: #5293d8;
}
status-bar .latex-status .latex-warning {
  color: #ff982d;
}
status-bar .latex-status .latex-error {
  color: #c00;
}
status-bar .latex-status a {
  cursor: pointer;
}
status-bar .latex-status .icon {
  padding-right: 0.125em;
  display: inline-block;
}
status-bar .latex-status.is-busy {
  color: #fff;
}
status-bar .latex-status.is-busy a {
  color: #fff;
}
status-bar .latex-status.is-busy .busy.icon::before {
  -webkit-animation: spin 2s infinite linear;
  text-align: center;
}
.latex-log {
  flex: 1 1 auto;
  display: flex;
  flex-direction: column;
  padding: 0.375em;
}
.latex-log .log-block {
  padding: 0.375em;
  flex: 0 1 auto;
}
.latex-log .log-block.expand {
  border: 1px solid rgba(0, 0, 0, 0.5);
  overflow-y: scroll;
  flex: 1 1 auto;
}
.latex-log table {
  width: 100%;
}
.latex-log th {
  background-color: #292c2f;
  border: 1px solid rgba(0, 0, 0, 0.5);
}
.latex-log td {
  border: 1px none;
}
.latex-log td,
.latex-log th {
  vertical-align: top;
  padding: .05em .25em .05em .25em;
}
.latex-log .latex-info .icon {
  color: #5293d8;
}
.latex-log .latex-warning .icon {
  color: #ff982d;
}
.latex-log .latex-error .icon {
  color: #c00;
}
.latex-log .panel-body {
  margin-top: 5px;
  overflow-y: scroll;
}
.latex-log a.latex-file-reference {
  white-space: nowrap;
  color: #555;
}
.latex-log .latex-highlight {
  color: #fff;
}
@-webkit-keyframes spin {
  from {
    -webkit-transform: rotate(0deg);
  }
  to {
    -webkit-transform: rotate(360deg);
  }
}
